import React, { Component } from "react";
import {Alert, Card, Form, Profile} from 'tabler-react';

class AppProfile extends React.Component {
    render() {
        return (
        <div className="dashboard">
            <Card
                title="Profile"
                body={
                <div className="body">
                <Form>    
                    <Form.Input name="username" label="label" disabled/>
                    <Form.Input name="email" label="E-Mail" disabled />
                </Form>
                </div>
                }
            />
            <Alert type="warning" isDismissible>
                Lorem ipsum dolar sit amet, consectetur adipisicing elit.
            </Alert>
        </div>
        )
    }
}

export default AppProfile;
